import React, { Component }from "react";
class Footer extends Component{
  render(){
    const {todolist} =this.props
    const total=todolist.length
    const donetotal=todolist.reduce((a,b)=>{return a+(b.done=true?1:0)},0)
    console.log(donetotal)
    return(
      <div>
        <label>
          <input type={"checkbox"}/>
        </label>
        <span>
          <span>已完成0</span>全部{total}
        </span>
        <button>清除已完成</button>
      </div>
    )
  }
}
export default Footer;
